import { useNavigation, useRoute } from "@react-navigation/native";
import { ReactElement } from "react";
import {
  Image,
  ScrollView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
} from "react-native";
import { Screens } from "../schema/screen-names";

const zvieratka = [
  {
    name: "Dog",
    meno: "Pes",
    imageUrl:
      "data:image/jpeg;base64,",
  },
  {
    name: "Cat",
    meno: "Macka",
    imageUrl:
      "https://www.zoohit.sk/magazin/wp-content/uploads/2022/11/macka-caracat.jpeg",
  },
  {
    name: "Cow",
    meno: "Krava",
    imageUrl:
      "data:image/jpeg;base64,",
  },
  {
    name: "Goose",
    meno: "Hus",
    imageUrl:
      "data:image/jpeg;base64,",
  },
  {
    name: "Horse",
    meno: "Kon",
    imageUrl:
      "data:image/jpeg;base64,",
  },
];

export const Dvor = (): ReactElement => {
  const { navigate } = useNavigation();

  return (
    <ScrollView style={styles.rootContainer}>
      <View>
        {zvieratka.map((zv) => (
          <TouchableOpacity
            onPress={() => navigate(Screens.Zviera, { zviera: zv })}
            className="p-4 mt-4 justify-center items-center bg-gray-300"
          >
            <Text>{zv.meno.toUpperCase()}</Text>
          </TouchableOpacity>
        ))}
      </View>
    </ScrollView>
  );
};

export const Zvieratko = (): ReactElement => {
  const { params } = useRoute();
  return (
    <View className="flex-1 p-4 justify-center items-center gap-4">
      <Text>{params?.zviera.name}</Text>
      <Text>{params?.zviera.meno}</Text>
      <Image
        source={{ uri: params?.zviera.imageUrl }}
        width={100}
        height={100}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  rootContainer: { flexGrow: 1 },
});
